import React, { Component } from "react";

class Users extends Component {
  constructor(props){
    super(props);
  }
  renderUser = ()=>{
    return this.props.userList.map((user,index)=>{
      return (
        <tr>
          <td>{user.username}</td>
          <td>{user.name}</td>
          <td>{user.email}</td>
          <td>{user.phone}</td>
          <td>{user.username}</td>
        </tr>
      )
    })
  }
  render() {
    return (
      <div>
        <table className="table">
          <thead>
            <tr>
              <th />
              <th>Username</th>
              <th>Name</th>
              <th>Email</th>
              <th>Phone Number</th>
              <th>Type</th>
            </tr>
          </thead>
          <tbody>
            {this.renderUser()}
          </tbody>
        </table>
      </div>
    );
  }
}

export default Users;
